import React from "react";
import "./welcome.css";

const Welcome = () => {
  return (
    <div>
      <div class="card" data-tilt data-tilt-scale="0.95" data-tilt-startY="40">
        <div class="welcome">Welcome to</div>
        <div class="year">
          <span>Twenty</span>
          <span>Twenty</span>
          <span>One</span>
        </div>
      </div>
    </div>
  );
};

export default Welcome;
